                SET TEMP_INGREDIENTES = CONCAT(TEMP_INGREDIENTES,TEMP_QUANTIDADE);
			ELSE
				SET FRACIONADO = FALSE;
                SET TEMP_INGREDIENTES = CONCAT(TEMP_INGREDIENTES,TEMP_DESCRICAO);
                SET TEMP_INGREDIENTES = CONCAT(TEMP_INGREDIENTES,TEMP_QUANTIDADE);
